import React from 'react';
import "./about.css";

function About() {
    return (
        <div className='about'>
            <div className='about-top'>
                <div className='about-info'>
                    Hi, I am 
                    <br />Pentest Guy
                   <br /> I love to test Security
                </div>
                <div className='about-photo'></div>
            </div>
            <div className='about-bottom'></div>
        </div>
    )
}

export default About
